import React, { Component } from 'react';
import { tareas } from '../tareas.json';
class Navbar extends Component{
    constructor() {
        super();
        this.state = {
          tareas
        };
    }
render(){
    // mi retorno
    return(
        <div className="">
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
  <a className="navbar-brand" href="#">Aplicaci√≥n de Tareas</a>
  <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
    <span className="navbar-toggler-icon"></span>
  </button>
  <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
    <div className="navbar-nav">
      <a className="nav-item nav-link active" href="#">Tareas: <span className="sr-only">(current)</span></a>
      <span className="badge badge-light">
              {/* cuento las tareas que estan actualmente  */}
              {this.state.tareas.length}
            </span>
      <a className="nav-item nav-link" href="#">Graficos</a>
     
     
    </div>
  </div>
</nav>
         </div>   
    );
}


}
export default Navbar;
